import './App.css'
import Navbar from './Navbar';

class App extends Component {
    // our react code goes in here
    render() {
        return (
            <div>
                <Navbar/>
                <div className='text-center'>
                    <h>Hello, World!</h>
                </div>
            </div>
        )
    }
}

export default App;

